            // return `Eror: ${this.state.error.message}`;
          }    
        return(
            <React.Fragment>
                <div className="body">
                    <Header></Header>            
                    <main className="main">
                    <article className="container-producto">
                    <Lista img="" nombre="BOM BOM BUN" valor="300" />




                    </article>


